import React from "react";
import ExpenseItem from "./ExpenseItem.js";

const Expenses = (props) => {
  return (
    <div>
      <ExpenseItem
        title={props.expen[0].title}
        amount={props.expen[0].amount}
        date={props.expen[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={props.expen[1].title}
        amount={props.expen[1].amount}
        date={props.expen[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={props.expen[2].title}
        amount={props.expen[2].amount}
        date={props.expen[2].date}
      ></ExpenseItem>
    </div>
  );
};

export default Expenses;
